import React from 'react';

const images = [
  'forest1', 'forest2', 'forest3',
  'mountain1', 'mountain2', 'mountain3',
  'river1', 'river2', 'river3'
]

const buildURL = imagePath => `https://assets.imgix.net/tutorials/${imagePath}.webp`

const Artworks = () => (
  <>
    <h1>Artworks</h1>
    <div style={{backgroundColor: "white", height: "100vh", display: "flex", justifyContent: "center", alignItems: "center"}}>
      <div className="gallery">
        {images.map(image => (
          <Imgix
            sizes="(min-width: 960px) 33vw, (min-width: 640px) 50vw, 100vw"
            src={buildURL(image)}
            imgixParams={{
              fit: "crop",
              fm: "jpg"
            }}
            width={600}
            height={600}
          />
        ))}
      </div>
    </div>
  </>
);

export default Artworks;
